    return (
        <>
        <div className="App">
            <AddEventPanel refreshEvents={getEvents}/>
            <h1>Kalendarz</h1>
            {events.map(item => (
                <Card
                    name={item.name}
                    date={item.date}
                    />
            ))}
        </div>
        </>
    )

}

export default Callendar;
